column7:
Screeningen tijdens de zwangerschap en net na de geboorte sporen eventuele complicaties, ziekten en aandoeningen vroegtijdig op. Doel hiervan is zo snel mogelijk met een behandeling te beginnen of handelingsopties te bieden

De screeningen tijdens de zwangerschap zijn gericht op:
- Het opsporen van infectieziekten en erytrocytenimmunisatie (PSIE) door middel van bloedonderzoek vóór de 13e zwangerschapsweek; 
- Het bepalen van een eventueel verhoogde kans op downsyndroom door bloed- en echo onderzoek; 
-Het opsporen van lichamelijke afwijkingen door middel van een echo bij 20 weken zwangerschap.

De screeningen tijdens de zwangerschap en na de geboorte behoren tot de landelijke bevolkingsonderzoeken.
